import React from 'react';
import './PopCardStyles.scss';
import {withRouter} from 'react-router-dom';
import PopYTpage from '../../pages/pop-search-page/PopYoutubePage';

import { connect } from 'react-redux';
import { change_youtube_url } from '../../actions';

const mapDispatchToProps = dispatch => {
	return {
		change_youtube_url: (YTurl) => dispatch(change_youtube_url(YTurl))
	}
}

const PopCard = ({id, name, song, album, date, yt_url, history, match}) => {
	const linkUrl = 'pop_search_yt';
  const handleClick = (i) => {
    change_youtube_url(i);
    history.push(`${linkUrl}`);
    console.log(i);
  }

	return(
		<div className='dib br4 pa3 ma2 grow bw2 shadow-5 card-display'>
			<h2>{song}</h2>
			<h3>by {name}</h3>
			<h4>Album/Single: {album}</h4>
			<p>Realease date: {date}</p>
			<button 
				className="box-container"
				onClick={() =>
					handleClick(yt_url)}
			>
				HIT THIS SONG
			</button>
		</div>
	)
}

export default withRouter(connect(mapDispatchToProps)(PopCard));








